import breakingBad from "../data/breakingBad.jpeg";
import { Link } from "react-router-dom";

const Welcome = () => {
  return (
    <div>
      <h1>Welcome To...</h1>
      <img src={breakingBad} alt="breaking bad" style={{ width: "100%" }} />

      <div>
        <img src={breakingBad} alt="breaking bad" style={{ width: "100%" }} />
        <Link
          to="/characters"
          style={{
            color: "white",
            textDecoration: "none",
            margin: 0,
            padding: 0,
          }}
        >
          <h3>View Breaking Bad characters</h3>
        </Link>
        ;
      </div>
      <div style={{display: "grid", gridTemplateColumns: "1fr 1fr"}}>
        <img src={breakingBad} alt="breaking bad" style={{ width: "100%" }} />
        <Link
          to="/characters"
          style={{
            color: "white",
            textDecoration: "none",
            margin: 0,
            padding: 0,
          }}
        >
          <h3>Read Breaking Bad Quotes</h3>
        </Link>
        ;
      </div>
    </div>
  );
};

export default Welcome;
